from .context import gpytoolbox as gpy
from .context import numpy as np
from .context import scipy as sp
from .context import unittest

class TestAdjacencyMatrix(unittest.TestCase):

    def test_single_triangle(self):
        F = np.array([[0,1,2]], dtype=int)
        A = gpy.adjacency_matrix(F).todense()

        E = np.array([[0,1],[1,2],[2,0]], dtype=int)
        AE = gpy.adjacency_matrix(E).todense()

        self.assertTrue(np.all(A==AE))
        self.assertTrue(np.all(A==A.T))

        A_gt = np.array([[0,1,1],[1,0,1],[1,1,0]])
        self.assertTrue(np.all(A==A_gt))
    
